import React from 'react'
import ReactDOM from 'react-dom'
const sum = 5;
const date= new Date().toLocaleDateString();
const date2= new Date().toLocaleTimeString();
const minus=78;
ReactDOM.render(<><h1>hello</h1>
<p> {`top ${date}  ${minus} netflix series`} </p>
<p>top {4+3} netflix top series</p>
<p>top {7/6} netflix top series</p>
<p>top {Math.random()} netflix top series</p>
</>
,document.getElementById('root'))
